import Grid from '@mui/material/Grid';

export function FolderGroup(){
    return(
        <Grid className='Container-Properties'>
            <item><Foldericon></Foldericon></item>
            <item><FolderText></FolderText></item><FolderText></FolderText>
        </Grid>
    )
} 

export function Foldericon(){
    return(
        <img src='https://win98icons.alexmeub.com/icons/png/directory_closed_cool-3.png'
        className='Folder-icon'
        alt='Folder icon'
        />
    )
}

export function FolderText(text){
    text = "Who am I?"
    return(
        <h2 className='FolderText'>
            {text}
        </h2>
    )
}
